const App = () => {
  return (
    <main>
      {/*<NavBar />*/}
      {/*<Container>*/}
        <Routes>
          <Route path="*" element={<div>Aaa</div>} />
          <Route path="/" element={<div>Bbbb</div>} />
          <Route path="/post/:id" element={<div>Cccc</div>} />
          <Route path="/post/add" element={<div>Dddd</div>} />
          <Route path="/post/edit/:id" element={<div>Eeee</div>} />
          <Route path="/about" element={<div>Ffff</div>} />
        </Routes>
      {/*</Container>*/}
    </main>
  );
};
export default App;
